import { View, Text, TouchableOpacity, Image } from 'react-native'
import React from 'react'

const CategoryCard = ({imgUrl, title}) => {
  return (
    <TouchableOpacity>
        <Image  source={{
            url: imgUrl
        }}

        className='h-20 w-20 rounded'
        />
      <Text>{title}</Text>
    </TouchableOpacity>
  )
}

export default CategoryCard
